import {Grid, Table, TableCell, TableHead, TableRow} from "@material-ui/core";
import HeaderMenu from "../components/HeaderMenu";
import {connect} from "react-redux";
import React from "react";

const Status = (props) => {

	console.log(props);

	return (
		<Grid
			xs={12}
			sm={12}
			lg={12}
			md={12}
			item
			container
		>
			<HeaderMenu history={props.history} />
			<Table>
				<TableHead>
					<TableRow>
						<TableCell>
							ID
						</TableCell>
						<TableCell>
							Name
						</TableCell>
						<TableCell>
							CREATE DATE
						</TableCell>
						<TableCell>
							ACTIONS
						</TableCell>
					</TableRow>
				</TableHead>
			</Table>
		</Grid>
	);
}

const mapStateToProps = state => state.StatusStore;

const mapDispatchToProps = dispatch => ({});

export default connect(mapStateToProps, mapDispatchToProps)(Status);
